{'published': '05 May 2009, 00:40', 'summary': '"Never Mind the Bollocks Here's the Sex Pistols" is the first and only album recorded by the Sex Pistols, a highly influential and controversial English punk band. Fans and critics alike generally regard the album as an extremely important record in the history of rock music, citing the lasting influence it has had on subsequent punk musicians and other musical genres that were influenced by such punk rock artists. The album was released on 28 October 1977 on the Virgin Records label, amid controversy arising from the use of the obscenity (in British English) "bollocks" in its title. Older versions <a href="https://www.last.fm/music/Sex+Pistols/Never+Mind+the+Bollocks+Here%27s+the+Sex+Pistols">Read more on Last.fm</a>.', 'content': '"Never Mind the Bollocks Here's the Sex Pistols" is the first and only album recorded by the Sex Pistols, a highly influential and controversial English punk band. Fans and critics alike generally regard the album as an extremely important record in the history of rock music, citing the lasting influence it has had on subsequent punk musicians and other musical genres that were influenced by such punk rock artists.

The album was released on 28 October 1977 on the Virgin Records label, amid controversy arising from the use of the obscenity (in British English) "bollocks" in its title.

Older versions of most of the album's songs also appeared on a bootleg album called Spunk, which consists of demo recordings the band had made during 1976 and January 1977, and which was released shortly before Never Mind the Bollocks. <a href="https://www.last.fm/music/Sex+Pistols/Never+Mind+the+Bollocks+Here%27s+the+Sex+Pistols">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2010, 00:12', 'summary': 'Easily one of the most important records ever made, John Coltrane's A Love Supreme was his pinnacle studio outing that at once compiled all of his innovations from his past, spoke of his current deep spirituality, and also gave a glimpse into the next two and a half years (sadly, those would be his last). Recorded at the end of 1964, Trane's classic quartet of Elvin Jones, McCoy Tyner, and Jimmy Garrison stepped into the studio and created one of the most thought-provoking, concise, and technically pleasing albums of their bountiful relationship (not to mention his best-selling to date). From <a href="https://www.last.fm/music/John+Coltrane/A+Love+Supreme">Read more on Last.fm</a>.', 'content': '
Easily one of the most important records ever made, John Coltrane's A Love Supreme was his pinnacle studio outing that at once compiled all of his innovations from his past, spoke of his current deep spirituality, and also gave a glimpse into the next two and a half years (sadly, those would be his last). Recorded at the end of 1964, Trane's classic quartet of Elvin Jones, McCoy Tyner, and Jimmy Garrison stepped into the studio and created one of the most thought-provoking, concise, and technically pleasing albums of their bountiful relationship (not to mention his best-selling to date). From the undulatory (and classic) bassline at the intro to the last breathy notes, Trane is at the peak of his logical yet emotionally varied soloing while the rest of the group is remarkably in tune with Coltrane's spiritual vibe. Composed of four parts, each has a thematic progression leading to an understanding of spirituality through meditation. From the beginning, "Acknowledgement" is the awakening of sorts that trails off to the famous chanting of the theme at the end, which yields to the second act, "Resolution," an amazingly beautiful piece about the fury of dedication to a new path of understanding. "Persuance" is a search for that understanding, and "Psalm" is the enlightenment. Although he is at times aggressive and atonal, this isn't Trane at his most adventurous (pretty much everything recorded from here on out progressively becomes much more free, and live recordings from this period are extremely spirited), but it certainly is his best attempt at the realization of concept -- as the spiritual journey is made amazingly clear. A Love Supreme clocks in at just over 30 minutes, but if it had been any longer it could have turned into a laborious listen. As it stands, just enough is conveyed. It is almost impossible to imagine a world without A Love Supreme having been made, and it is equally impossible to imagine any jazz collection without it.

John Coltrane Quartet: John Coltrane – tenor saxophone, bandleader; Jimmy Garrison – double bass; Elvin Jones – drums; McCoy Tyner – piano <a href="https://www.last.fm/music/John+Coltrane/A+Love+Supreme">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2013, 20:34', 'summary': 'It Takes a Nation of Millions to Hold Us Back is the second studio album by American hip hop group Public Enemy, released in April 1988 by Def Jam Recordings. Public Enemy set out to make the hip hop equivalent to Marvin Gaye's What's Going On, an album noted for its strong social commentary. Recording sessions took place during 1987 at Chung King Studios, Greene St. Recording, and Sabella Studios in New York City. Noting the enthusiastic response toward their live shows, Public Enemy intended with Nation of Millions to make the music of a faster tempo than the previous <a href="https://www.last.fm/music/Public+Enemy/It+Takes+a+Nation+of+Millions+to+Hold+Us+Back">Read more on Last.fm</a>.', 'content': 'It Takes a Nation of Millions to Hold Us Back is the second studio album by American hip hop group Public Enemy, released in April 1988 by Def Jam Recordings. Public Enemy set out to make the hip hop equivalent to Marvin Gaye's What's Going On, an album noted for its strong social commentary. Recording sessions took place during 1987 at Chung King Studios, Greene St. Recording, and Sabella Studios in New York City. Noting the enthusiastic response toward their live shows, Public Enemy intended with Nation of Millions to make the music of a faster tempo than the previous album for performance purposes.

The album charted for 49 weeks on the US Billboard 200, peaking at number 42. By August 1989, it was certified platinum by the Recording Industry Association of America, for shipments of one million copies in the United States. The album was very well received by music critics, who hailed it for its production techniques and the socially and politically charged lyricism of lead MC Chuck D. It also appeared on many publications' year-end top album lists for 1988, and was the runaway choice as the best album of 1988 in The Village Voice's Pazz & Jop critics' poll, a poll of the leading music critics in the US.

Since its initial reception, It Takes a Nation of Millions to Hold Us Back has been regarded by music writers and publications as one of the greatest and most influential albums of all time. In 2003, the album was ranked number 48 on Rolling Stone magazine's list of the 500 greatest albums of all time, the highest ranking of all the hip hop albums on the list. <a href="https://www.last.fm/music/Public+Enemy/It+Takes+a+Nation+of+Millions+to+Hold+Us+Back">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2010, 18:37', 'summary': 'Whereas most great live rock albums are about energy, At Fillmore East is like a great live jazz session, where the pleasure comes from the musicians' interaction and playing. The great thing about that is, the original album that brought the Allmans so much acclaim is as notable for its clever studio editing as it is for its performances. Producer Tom Dowd skillfully trimmed some of the performances down to relatively concise running time (edits later restored on the double-disc set The Fillmore Concerts), at times condensing several performances into one track. Far from being a sacrilege, this tactic helps <a href="https://www.last.fm/music/The+Allman+Brothers+Band/At+Fillmore+East">Read more on Last.fm</a>.', 'content': 'Whereas most great live rock albums are about energy, At Fillmore East is like a great live jazz session, where the pleasure comes from the musicians' interaction and playing. The great thing about that is, the original album that brought the Allmans so much acclaim is as notable for its clever studio editing as it is for its performances. Producer Tom Dowd skillfully trimmed some of the performances down to relatively concise running time (edits later restored on the double-disc set The Fillmore Concerts), at times condensing several performances into one track. Far from being a sacrilege, this tactic helps present the Allmans in their best light, since even if the music isn't necessarily concise (three tracks run over ten minutes, with two in the 20-minute range), it does showcase the group's terrific instrumental interplay, letting each member (but particularly guitarist Duane and keyboardist/vocalist Gregg) shine. Even after the release of the unedited concerts, this original double album (single CD) remains the pinnacle of the Allmans and Southern rock at its most elastic, bluesy, and jazzy.  

A good idea that worked out even better, with one small caveat. The Fillmore Concerts is made up of performances from the two Fillmore shows that originally comprised Live at the Fillmore East and the concert portions of Eat a Peach, plus one track ("One Way Out") from a Fillmore show from a couple of months later. The 16-track masters from each show are transferred to digital and remixed by original producer Tom Dowd. The sound is sterling and the two-hour-plus running time makes this a dream for fans of the band, as well as an improvement on the original releases of this material. It is also a slightly less honest release, where "In Memory of Elizabeth Reed" is concerned — Dowd edited the version here together from two different performances, first and second shows, the dividing line being where Duane Allman's solo comes in. Not that this is the only concert album where this kind of editing has been done, but the original Live at the Fillmore contained a single take of the song, and some purists may prefer that. Otherwise, this set runs circles around more than 99 percent of the guitar albums ever released, with breathtaking sound (which, unlike the similarly conceived but less effective Derek & the Dominos Live at the Fillmore, loses none of its bite), and most fans might as well start here. 

 <a href="https://www.last.fm/music/The+Allman+Brothers+Band/At+Fillmore+East">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2017, 01:40', 'summary': 'Kid A is the fourth studio album by the English rock band Radiohead, released on 2 October 2000 by Parlophone. On the verge of a breakdown after promoting Radiohead's 1997 album OK Computer, songwriter Thom Yorke envisioned a radical change in direction. Radiohead replaced their rock sound with synthesisers, drum machines, the ondes Martenot, string orchestras and brass instruments, incorporating influences from genres such as electronic music, krautrock, jazz, and 20th-century classical music. They recorded Kid A with OK Computer producer Nigel Godrich in Paris, Copenhagen, Gloucestershire and their hometown Oxford, England. The sessions produced over 20 tracks; Radiohead saved <a href="https://www.last.fm/music/Radiohead/Kid+A">Read more on Last.fm</a>.', 'content': 'Kid A is the fourth studio album by the English rock band Radiohead, released on 2 October 2000 by Parlophone. On the verge of a breakdown after promoting Radiohead's 1997 album OK Computer, songwriter Thom Yorke envisioned a radical change in direction. Radiohead replaced their rock sound with synthesisers, drum machines, the ondes Martenot, string orchestras and brass instruments, incorporating influences from genres such as electronic music, krautrock, jazz, and 20th-century classical music. They recorded Kid A with OK Computer producer Nigel Godrich in Paris, Copenhagen, Gloucestershire and their hometown Oxford, England. The sessions produced over 20 tracks; Radiohead saved many of them for their subsequent album, Amnesiac, released the following year.

Radiohead released no singles or music videos to promote Kid A and conducted few interviews and photoshoots, instead becoming one of the first major acts to use the internet as a promotional tool. The album was made available to stream and was promoted with short animated films featuring music and artwork. Bootlegs of early performances were shared on filesharing services and the album was leaked before release.

Kid A debuted at the top of the charts in Britain, where it went platinum in the first week, and it became Radiohead's first number-one album in the United States. Like OK Computer, it won a Grammy for Best Alternative Album and was nominated for Album of the Year. Its departure from Radiohead's earlier sound initially divided fans and critics, but it later attracted widespread acclaim; at the turn of the decade, Rolling Stone, Pitchfork and the Times ranked Kid A the greatest album of the 2000s, and in 2012, Rolling Stone ranked it number 67 on its list of the 500 greatest albums of all time. <a href="https://www.last.fm/music/Radiohead/Kid+A">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2020, 06:45', 'summary': 'Star Time is a 1991 71-track, 4-CD box set by James Brown. Its contents span most of the length of his career up to the time of its release, starting in 1956 with his first hit record, "Please, Please, Please", and ending with "Unity", his 1984 collaboration with Afrika Bambaataa. Writing in 2007, Robert Christgau described it as "the finest box set ever released... as essential a package as the biz has ever hawked, not just because it's James Brown, but because compilers Cliff White and Harry Weinger invested so much care and knowledge in it." Its title comes from <a href="https://www.last.fm/music/James+Brown/Star+Time">Read more on Last.fm</a>.', 'content': 'Star Time is a 1991 71-track, 4-CD box set by James Brown. Its contents span most of the length of his career up to the time of its release, starting in 1956 with his first hit record, "Please, Please, Please", and ending with "Unity", his 1984 collaboration with Afrika Bambaataa. Writing in 2007, Robert Christgau described it as "the finest box set ever released... as essential a package as the biz has ever hawked, not just because it's James Brown, but because compilers Cliff White and Harry Weinger invested so much care and knowledge in it." Its title comes from the question Brown's announcer would ask concert audiences, as heard on the album Live at the Apollo: "Are you ready for star time?"

Star Time's liner notes, written by Cliff White, Harry Weinger, Nelson George, Alan Leeds, and Brown himself, won a 1991 Grammy Award for Best Album Notes. The notes also include a discography and a one-page comic by Mary Fleener, a visual interpretation of the song "I Got You (I Feel Good)."

In 2003, the album was ranked number 79 on Rolling Stone magazine's list of the 500 greatest albums of all time. It was the second-highest ranking box set on the list. In 2012, the rank moved up to 75. <a href="https://www.last.fm/music/James+Brown/Star+Time">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2013, 21:57', 'summary': 'Otis Blue: Otis Redding Sings Soul, or simply Otis Blue, released September 15, 1965 on Stax Records, is the third studio album by soul singer Otis Redding. The album mainly consists of cover songs by popular R&B and soul artists, and, bar one track, was recorded in a 24-hour period over July 9/10 1965 at the Stax Recording Studios in Memphis, Tennessee. Otis Blue was critically acclaimed upon release and became one of Redding’s most successful albums; it reached number 6 on the UK Albums Chart, and was his first to reach the top spot of the Billboard R&B chart. <a href="https://www.last.fm/music/Otis+Redding/Otis+Blue:+Otis+Redding+Sings+Soul">Read more on Last.fm</a>.', 'content': 'Otis Blue: Otis Redding Sings Soul, or simply Otis Blue, released September 15, 1965 on Stax Records, is the third studio album by soul singer Otis Redding. The album mainly consists of cover songs by popular R&B and soul artists, and, bar one track, was recorded in a 24-hour period over July 9/10 1965 at the Stax Recording Studios in Memphis, Tennessee. Otis Blue was critically acclaimed upon release and became one of Redding’s most successful albums; it reached number 6 on the UK Albums Chart, and was his first to reach the top spot of the Billboard R&B chart. Furthermore, it produced three popular singles, all charting at least in the top 50 on both the Billboard R&B and the Billboard Hot 100 chart. It is considered by many critics to be Redding’s first fully realized album.

Three of the eleven songs were written by Redding: “Ole Man Trouble”, “Respect”, and “I’ve Been Loving You Too Long”. Three songs were written by Sam Cooke, a soul musician who had died a few months earlier. As was the case in the previous albums, Redding was backed by house band Booker T. & the M.G.’s, a horn section of members of The Mar-Keys and The Memphis Horns, and pianist Isaac Hayes.

Otis Blue is included in a number of “best album” lists, including Rolling Stone’s 500 Greatest Albums of All Time, Time magazine’s list of the All-Time 100 Greatest Albums, and Robert Dimery’s “1001 Albums You Must Hear Before You Die”.  <a href="https://www.last.fm/music/Otis+Redding/Otis+Blue:+Otis+Redding+Sings+Soul">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '11 Nov 2008, 12:10', 'summary': 'By January 1977, punk had become a major media phenomenon in the UK. On 25 January 1977, The Clash signed to CBS Records for £100,000, a remarkable amount for a band that had played a total of about thirty gigs and almost none as a headliner. As Clash historian Marcus Gray describes, the "band members found themselves having to justify to both the music press and to fans who picked up on the critics' muttered asides about The Clash having 'sold out' to the establishment."Mark Perry, founder of the leading London punk periodical, Sniffin' Glue, let loose with what he <a href="https://www.last.fm/music/The+Clash/The+Clash">Read more on Last.fm</a>.', 'content': 'By January 1977, punk had become a major media phenomenon in the UK. On 25 January 1977, The Clash signed to CBS Records for £100,000, a remarkable amount for a band that had played a total of about thirty gigs and almost none as a headliner. As Clash historian Marcus Gray describes, the "band members found themselves having to justify  to both the music press and to fans who picked up on the critics' muttered asides about The Clash having 'sold out' to the establishment."Mark Perry, founder of the leading London punk periodical, Sniffin' Glue, let loose with what he would later call his "big quote": "Punk died the day The Clash signed to CBS."

Mickey Foote, who worked as a technician at their concerts, was hired to produce The Clash's debut album, and Terry Chimes was drafted on drums for the recording. The band's first single, "White Riot", was released in March; the album, The Clash, came out the following month. Filled with fiery punk tracks, it also presaged the many eclectic turns the band would take with its cover of the reggae song "Police and Thieves". Though both the single and album charted well in the UK—"White Riot" reached number 34, The Clash number 12—CBS refused to release either in the United States, saying that the sound was not “radio friendly”.A US version of the album (this version) with a modified track listing was released in 1979, after the UK original became the best-selling import album of all time in the United States.
 <a href="https://www.last.fm/music/The+Clash/The+Clash">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '02 Feb 2009, 00:01', 'summary': 'Harvest is an album by Neil Young, which was the best-selling album of 1972. The album featured several high calibre guests, including the London Symphony Orchestra, Linda Ronstadt, Stephen Stills, Graham Nash, David Crosby and James Taylor. Harvest hit #1 on the Billboard Music Charts (North America) pop albums chart, spawning two hit singles, "Old Man", which peaked at #31 on the Billboard Hot 100, and "Heart of Gold", which peaked at #1. After the supergroup Crosby, Stills, Nash & Young split, Young recruited a new group of country session musicians, which he christened The Stray Gators and recorded a <a href="https://www.last.fm/music/Neil+Young/Harvest">Read more on Last.fm</a>.', 'content': 'Harvest is an album by Neil Young, which was the best-selling album of 1972. The album featured several high calibre guests, including the London Symphony Orchestra, Linda Ronstadt, Stephen Stills, Graham Nash, David Crosby and James Taylor. Harvest hit #1 on the Billboard Music Charts (North America) pop albums chart, spawning two hit singles, "Old Man", which peaked at #31 on the Billboard Hot 100, and "Heart of Gold", which peaked at #1.

After the supergroup Crosby, Stills, Nash & Young split, Young recruited a new group of country session musicians, which he christened The Stray Gators and recorded a country rock record in Harvest. The record was a massive hit, producing a US number one single in "Heart of Gold". Other songs returned to some usual Young themes: "Alabama" was "an unblushing rehash of 'Southern Man'"; "Words (Between the Lines of Age)" featured a lengthy guitar workout with the band; and "The Needle and the Damage Done" was a lament for great artists who had died of heroin addiction, particularly Danny Whitten of Crazy Horse. The album's success caught Young off guard and his first instinct was to back away from stardom. He would later write that "Heart of Gold" "put me in the middle of the road. Traveling there soon became a bore so I headed for the ditch. A rougher ride but I saw more interesting people there."
 <a href="https://www.last.fm/music/Neil+Young/Harvest">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2013, 03:26', 'summary': 'Sweet Baby James is singer-songwriter James Taylor's second album, and his first release on Warner Bros. Records. Released in February 1970, it showcased Taylor's talents and showed the direction he would take in the early 1970s with the expansion of his career. The album featured one of Taylor's earliest single successes: "Fire and Rain", which reached #3 on the Billboard Hot 100. The album itself also managed to reach #3 on the Billboard Album Charts. Sweet Baby James made Taylor one of the main forces of the ascendent folk movement. The album was nominated to a Grammy Award for Album <a href="https://www.last.fm/music/James+Taylor/Sweet+Baby+James">Read more on Last.fm</a>.', 'content': 'Sweet Baby James is singer-songwriter James Taylor's second album, and his first release on Warner Bros. Records. Released in February 1970, it showcased Taylor's talents and showed the direction he would take in the early 1970s with the expansion of his career. The album featured one of Taylor's earliest single successes: "Fire and Rain", which reached #3 on the Billboard Hot 100. The album itself also managed to reach #3 on the Billboard Album Charts. Sweet Baby James made Taylor one of the main forces of the ascendent folk movement. The album was nominated to a Grammy Award for Album of the Year, in 1971. The album was listed at #103 on Rolling Stone's 500 Greatest Albums of All Time.

The album, produced by Peter Asher, was recorded between 8 and 17 December 1969 at a cost of only $7,600 out of a budget of $20,000. Taylor was "essentially homeless" at the time the album was recorded, either staying in Asher's home or crashing on a couch at the house of guitarist Danny Kortchmar or anyone else who would have him.

The song "Suite for 20 G" was so named because Taylor was promised $20,000 once the album was delivered. With one more song needed, he strung together three unfinished songs into a "suite," and completed the album. <a href="https://www.last.fm/music/James+Taylor/Sweet+Baby+James">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '12 Dec 2018, 15:37', 'summary': 'Modern Sounds in Country and Western Music is a studio album by American R&B singer-songwriter and musician Ray Charles. It was recorded by Charles in February 1962 at Capitol Studios in New York City and at United Recording Studios in Hollywood, then released in April of that year by ABC-Paramount Records. The album departed stylistically from the singer's previous rhythm and blues music. It featured country, folk, and Western music standards reworked by Charles in popular song forms of the time, including R&B, pop, and jazz. As his fifth LP release for ABC-Paramount, Modern Sounds in Country and Western Music <a href="https://www.last.fm/music/Ray+Charles/Modern+Sounds+in+Country+and+Western+Music">Read more on Last.fm</a>.', 'content': 'Modern Sounds in Country and Western Music is a studio album by American R&B singer-songwriter and musician Ray Charles. It was recorded by Charles in February 1962 at Capitol Studios in New York City and at United Recording Studios in Hollywood, then released in April of that year by ABC-Paramount Records. The album departed stylistically from the singer's previous rhythm and blues music. It featured country, folk, and Western music standards reworked by Charles in popular song forms of the time, including R&B, pop, and jazz.

As his fifth LP release for ABC-Paramount, Modern Sounds in Country and Western Music became a rapid critical and commercial success as it brought Ray Charles further mainstream notice, following his tenure for Atlantic Records. With the help of the album's four charting singles, Charles earned recognition in the pop market, as well as airplay on both R&B and country radio stations. Modern Sounds and its lead single, "I Can't Stop Loving You", were both certified gold by the Recording Industry Association of America in 1962, as each record had shipped 500,000 copies in the United States.

Regarded by many critics as Charles's best studio album, Modern Sounds in Country and Western Music has been considered by several music writers to be a landmark album in American music. The album's integration of soul and country music bent racial barriers in popular music, amid the height of the Civil Rights Movement. In the process of recording the album, Charles became one of the first African-American musicians to exercise complete artistic control over his own recording career. The album has been called one of the greatest albums of all time by publications such as Rolling Stone and Time. <a href="https://www.last.fm/music/Ray+Charles/Modern+Sounds+in+Country+and+Western+Music">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2013, 22:06', 'summary': 'Aftermath, first released on 15 April 1966 by Decca Records, is the fourth British studio album by The Rolling Stones. It was released in the United States on 20 June 1966 by London Records as their sixth American album. The album proved to be a major artistic breakthrough for the band, being the first full-length release by the band to consist exclusively of Mick Jagger/Keith Richards compositions. Aftermath was also the first Rolling Stones album to be recorded entirely in the US, at the legendary RCA Studios in Hollywood, California at 6363 Sunset Boulevard, and the first album the band <a href="https://www.last.fm/music/The+Rolling+Stones/Aftermath">Read more on Last.fm</a>.', 'content': 'Aftermath, first released on 15 April 1966 by Decca Records, is the fourth British studio album by The Rolling Stones. It was released in the United States on 20 June 1966 by London Records as their sixth American album. The album proved to be a major artistic breakthrough for the band, being the first full-length release by the band to consist exclusively of Mick Jagger/Keith Richards compositions. Aftermath was also the first Rolling Stones album to be recorded entirely in the US, at the legendary RCA Studios in Hollywood, California at 6363 Sunset Boulevard, and the first album the band released in true stereo.

The album is also notable for its musical experimentation, with Brian Jones playing a variety of instruments not usually associated with rock music—including sitar on "Paint It, Black" and "Mother's Little Helper", the Appalachian dulcimer on "Lady Jane" and "I Am Waiting", the marimbas (African xylophone) on "Under My Thumb" and "Out of Time", harmonica on "High and Dry" and "Goin' Home", as well as guitar and keyboards. Much of the music was still rooted in Chicago electric blues.

In August 2002 both editions of Aftermath were reissued in a new remastered CD and SACD digipak by ABKCO Records. <a href="https://www.last.fm/music/The+Rolling+Stones/Aftermath">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2021, 04:10', 'summary': 'Pearl is the second and final solo studio album by Janis Joplin, released on January 11, 1971, three months after her death on October 4, 1970. It was the final album with her direct participation, and the only Joplin album recorded with the Full Tilt Boogie Band, her final touring unit. It peaked at number one on the Billboard 200, holding that spot for nine weeks. It has been certified quadruple platinum by the RIAA. All nine tracks that she sings on were personally approved and arranged by Joplin. Joplin sang on all tracks except Buried Alive in the Blues, <a href="https://www.last.fm/music/Janis+Joplin/Pearl">Read more on Last.fm</a>.', 'content': 'Pearl is the second and final solo studio album by Janis Joplin, released on January 11, 1971, three months after her death on October 4, 1970. It was the final album with her direct participation, and the only Joplin album recorded with the Full Tilt Boogie Band, her final touring unit. It peaked at number one on the Billboard 200, holding that spot for nine weeks. It has been certified quadruple platinum by the RIAA.

All nine tracks that she sings on were personally approved and arranged by Joplin. Joplin sang on all tracks except Buried Alive in the Blues, which was actually a backing track in which she had not yet recorded vocals. The song's writer Nick Gravenites was offered the opportunity to sing it as a tribute to Joplin, but he turned it down, and as a result, the song ended up as an instrumental. The recording sessions, starting in early September, ended with Joplin's untimely death on October 4, 1970. Her final session, which took place on Thursday, October 1 after a break of several days, yielded her a cappella Mercedes Benz. It was the last song she recorded before her death.

The album cover, photographed by Barry Feinstein in Los Angeles, shows Joplin reclining on her Victorian era loveseat with a drink in her hand. <a href="https://www.last.fm/music/Janis+Joplin/Pearl">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

