Blondie's third album also introduced the world to the six-member lineup that would go on to chart with four US and five UK number one singles: Clem Burke (drums), Jimmy Destri (keyboards), Nigel Harrison (bass), Debbie Harry (vocals), Frank Infante (guitar), and Chris Stein (guitar).

Everyone in the band contributed songs, except Burke. Covers include two songs originally by The Nerves: "Hanging On The Telephone" and "Will Anything Happen?" (written by Jack Lee), and "I'm Gonna Love You Too", a Buddy Holly cover (written by Joe B. Mauldin, Norman Petty and Niki Sullivan). <a href="https://www.last.fm/music/Blondie/Parallel+Lines">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2012, 01:58', 'summary': 'Darkness on the Edge of Town is the fourth album by Bruce Springsteen, released in the late spring of 1978. The album marked the end of a three year period of forced hiatus from recording brought on by contractual obligations and legal battling with former manager Mike Appel.Although the album did not produce high charting singles it nevertheless remained on the charts for 97 weeks. The album failed to generate any substantial hit singles, although "Prove It All Night" made it into the Top 40 in the U.S. at #33, and follow-up "Badlands" just missed, peaking at #42. At the <a href="https://www.last.fm/music/Bruce+Springsteen/Darkness+on+the+Edge+of+Town">Read more on Last.fm</a>.', 'content': 'Darkness on the Edge of Town is the fourth album by Bruce Springsteen, released in the late spring of 1978. The album marked the end of a three year period of forced hiatus from recording brought on by contractual obligations and legal battling with former manager Mike Appel.Although the album did not produce high charting singles it nevertheless remained on the charts for 97 weeks.

The album failed to generate any substantial hit singles, although "Prove It All Night" made it into the Top 40 in the U.S. at #33, and follow-up "Badlands" just missed, peaking at #42.

At the time, Darkness claimed the number one slot on NME album of the year ranking. In 2003, the album was ranked number 151 on Rolling Stone magazine's list of the 500 greatest albums of all time.The same year, the TV network VH1 named Darkness on the Edge of Town the 68th greatest album of all time. <a href="https://www.last.fm/music/Bruce+Springsteen/Darkness+on+the+Edge+of+Town">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '12 Dec 2009, 04:46', 'summary': 'Paul's Boutique is the second studio album by American hip hop group Beastie Boys, released on July 25, 1989 on Capitol Records. Featuring production by the Dust Brothers, the recording sessions for the album took place at Mario G's Studio in Los Angeles and The Opium Den in Brooklyn, New York from 1988 to 1989, after which the recordings underwent mixing at the Manhattan-based Record Plant Studios. Paul's Boutique was initially considered a commercial failure by the executives at Capitol Records, as its sales did not match that of the group's previous record, Licensed to Ill, and the label eventually <a href="https://www.last.fm/music/Beastie+Boys/Paul%27s+Boutique">Read more on Last.fm</a>.', 'content': 'Paul's Boutique is the second studio album by American hip hop group Beastie Boys, released on July 25, 1989 on Capitol Records. Featuring production by the Dust Brothers, the recording sessions for the album took place at Mario G's Studio in Los Angeles and The Opium Den in Brooklyn, New York from 1988 to 1989, after which the recordings underwent mixing at the Manhattan-based Record Plant Studios.

Paul's Boutique was initially considered a commercial failure by the executives at Capitol Records, as its sales did not match that of the group's previous record, Licensed to Ill, and the label eventually decided to stop promoting the album. The album's popularity continued to grow, however, and it has even been touted as a breakthrough achievement for the Beastie Boys. Highly varied lyrically and sonically, Paul's Boutique secured the Beastie Boys' place as critical favorites in the hip-hop genre, and has been widely recognized as the group's magnum opus. The album's rankings near the top of many publications' "best albums" lists in disparate genres has given Paul's Boutique critical recognition as a landmark album in hip hop.

On January 27, 1999, Paul's Boutique was certified double platinum in sales by the Recording Industry Association of America. In 2003, the album was ranked number 156 on Rolling Stone magazine's list of the 500 greatest albums of all time. The album was re-released in a 20th anniversary package featuring 24-bit remaster audio and a commentary track on January 27, 2009 <a href="https://www.last.fm/music/Beastie+Boys/Paul%27s+Boutique">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2020, 07:49', 'summary': 'Imperial Bedroom is a 1982 album by Elvis Costello and the Attractions. It was the second Costello album, after Almost Blue, not produced by Nick Lowe. Production duties were handled by Beatles engineer Geoff Emerick. "I wanted to try a few things in the studio that I suspected would quickly exhaust Nick's patience," as Costello put it in the liner notes to the 1994 Rykodisc reissue. It was voted as the best album of the year in The Village Voice Pazz & Jop critics poll. In 1998 readers of Q magazine named it the 96th greatest album ever. In 1989, <a href="https://www.last.fm/music/Elvis+Costello/Imperial+Bedroom">Read more on Last.fm</a>.', 'content': 'Imperial Bedroom is a 1982 album by Elvis Costello and the Attractions. It was the second Costello album, after Almost Blue, not produced by Nick Lowe. Production duties were handled by Beatles engineer Geoff Emerick. "I wanted to try a few things in the studio that I suspected would quickly exhaust Nick's patience," as Costello put it in the liner notes to the 1994 Rykodisc reissue.

It was voted as the best album of the year in The Village Voice Pazz & Jop critics poll. In 1998 readers of Q magazine named it the 96th greatest album ever. In 1989, it was ranked No. 38 on Rolling Stone magazine's list of The 100 Greatest Albums of the 80s. In 2003, the album was ranked number 166 on Rolling Stone magazine's list of the 500 greatest albums of all time, maintaining the rating in a 2012 revised list. It was voted number 321 in the third edition of Colin Larkin's All Time Top 1000 Albums (2000). In 2012, Slant Magazine listed the album at No. 59 on its list of "Best Albums of the 1980s". The album reached number 6 in the UK charts and number 30 in the USA but the singles were less successful. "You Little Fool" and "Man Out of Time" each briefly appeared in the UK Singles Chart, but neither charted in the USA.

 <a href="https://www.last.fm/music/Elvis+Costello/Imperial+Bedroom">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2008, 18:14', 'summary': 'Desire is singer-songwriter Bob Dylan's 17th studio album, released by Columbia Records in 1976. It is one of Dylan's most collaborative efforts, featuring the same caravan of musicians from the acclaimed Rolling Thunder Revue tours the previous year (later documented on The Bootleg Series Vol. 5). Most of the album was co-written by Jacques Levy, and is composed of lengthy story-songs, two of which quickly generated controversy: the over 11-minute long "Joey", which is seen as glorifying the violent gangster Joey Gallo, and "Hurricane", the opening track that tells a passionate account of the murder case against boxer Rubin Carter, <a href="https://www.last.fm/music/Bob+Dylan/Desire">Read more on Last.fm</a>.', 'content': 'Desire is singer-songwriter Bob Dylan's 17th studio album, released by Columbia Records in 1976.

It is one of Dylan's most collaborative efforts, featuring the same caravan of musicians from the acclaimed Rolling Thunder Revue tours the previous year (later documented on The Bootleg Series Vol. 5). Most of the album was co-written by Jacques Levy, and is composed of lengthy story-songs, two of which quickly generated controversy: the over 11-minute long "Joey", which is seen as glorifying the violent gangster Joey Gallo, and "Hurricane", the opening track that tells a passionate account of the murder case against boxer Rubin Carter, whom the song asserts was framed. Carter was later released - but not exonerated - on appeal more than twenty years later.

A well-received follow-up to Blood on the Tracks, Desire reached #1 on the Billboard Pop Albums chart for 5 weeks, becoming one of Dylan's top-selling studio albums (currently certified double platinum), while reaching #3 in the UK. <a href="https://www.last.fm/music/Bob+Dylan/Desire">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '11 Nov 2018, 01:48', 'summary': 'Modern Times is Bob Dylan's 32nd studio album, released on August 29, 2006 by Sony BMG. The album was Dylan's third straight (following Time out of Mind and "Love and Theft") to be met with nearly universal praise from fans and critics. It continued its predecessors' tendencies toward blues, rockabilly and pre-rock balladry, and was self-produced by Dylan under the pseudonym "Jack Frost". Along with the acclaim, the album sparked some debate over its uncredited use of choruses and arrangements from older songs, as well as many lyrical lines taken from the work of 19th century poet Henry Timrod. Modern <a href="https://www.last.fm/music/Bob+Dylan/Modern+Times">Read more on Last.fm</a>.', 'content': 'Modern Times is Bob Dylan's 32nd studio album, released on August 29, 2006 by Sony BMG.

The album was Dylan's third straight (following Time out of Mind and "Love and Theft") to be met with nearly universal praise from fans and critics. It continued its predecessors' tendencies toward blues, rockabilly and pre-rock balladry, and was self-produced by Dylan under the pseudonym "Jack Frost". Along with the acclaim, the album sparked some debate over its uncredited use of choruses and arrangements from older songs, as well as many lyrical lines taken from the work of 19th century poet Henry Timrod.

Modern Times became the singer-songwriter's first #1 album in the U.S. since 1976's Desire. At age 65, Dylan became the oldest living person at the time to have an album enter the Billboard charts at number one (Paul McCartney has since earned the title). It also reached #1 in Canada, Australia, New Zealand, Ireland, Denmark, Norway and Switzerland, debuted #2 in Germany, Austria and Sweden. It reached #3 in the UK and The Netherlands and has sold over 4 million copies worldwide. As with its two studio predecessors, the album's packaging features minimal credits and no lyric sheet. <a href="https://www.last.fm/music/Bob+Dylan/Modern+Times">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '04 Apr 2020, 15:56', 'summary': 'New York Dolls is the debut album by the American hard rock band New York Dolls. It was released on July 27, 1973, by Mercury Records. In the years leading up to the album, the Dolls had developed a local fanbase by playing regularly in lower Manhattan after forming in 1971. New York Dolls was met with widespread critical acclaim but sold poorly and polarized listeners. Despite its commercial failure, New York Dolls was an influential precursor to the 1970s punk rock movement as the group's crude musicianship and youthful attitude on the album threatened the prevailing trend of musical <a href="https://www.last.fm/music/New+York+Dolls/New+York+Dolls">Read more on Last.fm</a>.', 'content': 'New York Dolls is the debut album by the American hard rock band New York Dolls. It was released on July 27, 1973, by Mercury Records.

In the years leading up to the album, the Dolls had developed a local fanbase by playing regularly in lower Manhattan after forming in 1971.

New York Dolls was met with widespread critical acclaim but sold poorly and polarized listeners. Despite its commercial failure, New York Dolls was an influential precursor to the 1970s punk rock movement as the group's crude musicianship and youthful attitude on the album threatened the prevailing trend of musical sophistication in popular music, particularly progressive rock. Among the most acclaimed albums in history, it has since been named in various publications as one of the best debut records in rock music and one of the greatest albums of all time. <a href="https://www.last.fm/music/New+York+Dolls/New+York+Dolls">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2017, 01:42', 'summary': 'Loveless is the second studio album by Irish rock band My Bloody Valentine, released on 4 November 1991 by Creation Records. The album was recorded over a two-year period between 1989 and 1991. Vocalist and guitarist Kevin Shields dominated the arduous recording process; intent on achieving a particular sound, he experimented with guitar tremolo techniques and tuning systems, unorthodox production methods, obscured vocals, and sampled percussion and feedback. The group cycled through nineteen studios and a larger number of engineers during the album's two-year creation, with total recording costs rumoured to have reached £250,000. While Loveless did not achieve great <a href="https://www.last.fm/music/My+Bloody+Valentine/Loveless">Read more on Last.fm</a>.', 'content': 'Loveless is the second studio album by Irish rock band My Bloody Valentine, released on 4 November 1991 by Creation Records. The album was recorded over a two-year period between 1989 and 1991. Vocalist and guitarist Kevin Shields dominated the arduous recording process; intent on achieving a particular sound, he experimented with guitar tremolo techniques and tuning systems, unorthodox production methods, obscured vocals, and sampled percussion and feedback. The group cycled through nineteen studios and a larger number of engineers during the album's two-year creation, with total recording costs rumoured to have reached £250,000.

While Loveless did not achieve great commercial success upon its release, it received enthusiastic reviews from critics, who praised its sonic innovations and Shields's "virtual reinvention of the guitar." Following the record's release, My Bloody Valentine were removed from their record label Creation Records due to the difficulty and expense of working with Shields, a factor that was alleged to have contributed to the bankruptcy of the label. In the subsequent years, the group struggled to record a follow-up album and would eventually break up in 1997. Loveless would be their last full-length release for over two decades.

Since its release, Loveless has been widely proclaimed by critics as among the best albums of the 1990s, as a landmark work of the shoegazing genre, and as a significant influence on various subsequent artists. The album was reissued as a two-CD set on Sony in May 2012, containing remastered editions of the original digital tape and a previously unreleased ½-inch analogue tape. The reissues placed in several international charts and in July 2013, Loveless was certified Silver in the United Kingdom by the British Phonographic Industry (BPI). <a href="https://www.last.fm/music/My+Bloody+Valentine/Loveless">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

