Many of the songs deal with personal issues Raitt was struggling with at the time. For example, Raitt was almost forty years old when Nick of Time was released, and the album's title track is about coming to terms with middle age. Although Raitt only wrote two original songs for the album, the nine cover songs she chose also covey the overarching themes of adulthood and wisdom.

Nick of Time topped the Billboard 200 chart and won three Grammy Awards, including Album of the Year, which was presented to Raitt and producer Don Was. <a href="https://www.last.fm/music/Bonnie+Raitt/Nick+of+Time">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2009, 12:51', 'summary': 'Can’t Buy a Thrill is the first album by Steely Dan. Originally released in 1972, the album was a huge success. It went gold, and then platinum, peaking at #17 on the charts. In 2003, the album was ranked number 238 on Rolling Stone magazine’s list of the 500 greatest albums of all time. Two songs were left out from the album and released as a single (“Dallas” and “Sail the Waterway”), but to date they have not been released on CD. The album was originally released in two-channel Stereo and also in a special four-channel Quadrophonic mix. There are <a href="https://www.last.fm/music/Steely+Dan/Can%27t+Buy+A+Thrill">Read more on Last.fm</a>.', 'content': 'Can’t Buy a Thrill is the first album by Steely Dan. Originally released in 1972, the album was a huge success. It went gold, and then platinum, peaking at #17 on the charts. In 2003, the album was ranked number 238 on Rolling Stone magazine’s list of the 500 greatest albums of all time. Two songs were left out from the album and released as a single (“Dallas” and “Sail the Waterway”), but to date they have not been released on CD.

The album was originally released in two-channel Stereo and also in a special four-channel Quadrophonic mix. There are some significant musical differences between the two mixes, such as extra lead guitar fills in the Quad mix of Reelin’ in the Years.

The album cover features a line of prostitutes standing in a red light area waiting for clients, an image which was chosen because of its relevance to the album title. The title is taken from a line from Bob Dylan’s song “It Takes a Lot to Laugh, It Takes a Train to Cry”. <a href="https://www.last.fm/music/Steely+Dan/Can%27t+Buy+A+Thrill">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '04 Apr 2018, 06:52', 'summary': 'Whitney Houston is the debut studio album by American contemporary R&B and pop singer Whitney Houston. It was released on February 14, 1985, by Arista Records. The album initially had a slow commercial response, but began getting more popular in the summer of 1985. It eventually topped the Billboard 200 for 14 weeks in 1986, generating three number-one singles — "Saving All My Love for You", "How Will I Know" and "Greatest Love of All" (a cover of "The Greatest Love of All", originally recorded in 1977 by George Benson) — on the Billboard Hot 100 chart, which made it <a href="https://www.last.fm/music/Whitney+Houston/Whitney+Houston">Read more on Last.fm</a>.', 'content': 'Whitney Houston is the debut studio album by American contemporary R&B and pop singer Whitney Houston. It was released on February 14, 1985, by Arista Records. The album initially had a slow commercial response, but began getting more popular in the summer of 1985. It eventually topped the Billboard 200 for 14 weeks in 1986, generating three number-one singles — "Saving All My Love for You", "How Will I Know" and "Greatest Love of All" (a cover of "The Greatest Love of All", originally recorded in 1977 by George Benson) — on the Billboard Hot 100 chart, which made it both the first debut album and the first album by a solo female artist to produce three number-one singles. The album topped the albums charts in many countries, including Canada, Australia, Norway and Sweden, peaking at number 2 in the United Kingdom, Germany, and Switzerland. The album was certified diamond for shipments of 10 million units or more on March 16, 1999, and later 13× platinum by the Recording Industry Association of America on July 29, 1999, making it one of the top 100 best-selling albums in the United States. It has sold over 22 million copies worldwide.

In 1986, at the 28th Grammy Awards, Whitney Houston received four nominations; including Album of the Year  and won one, Best Pop Vocal Performance, Female for "Saving All My Love For You".  For the 29th Grammy Awards of 1987, the album received a Record of the Year nomination for "Greatest Love of All".  In 2003, the album was ranked 254 on the Rolling Stone magazine list of the 500 best albums of all time and this album appears at number 46 on the list of 200 definitive albums in the Rock and Roll Hall of Fame. 

In honor of its 25th anniversary, the album was reissued as Whitney Houston – The Deluxe Anniversary Edition on January 26, 2010, an expanded edition with five bonus tracks including the a cappella version of "How Will I Know" and the original 12-inch remixes, a booklet tracking the history of the original album, along with a DVD of live performances and interviews by Whitney Houston and Clive Davis. <a href="https://www.last.fm/music/Whitney+Houston/Whitney+Houston">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2009, 03:26', 'summary': 'Some Girls is an album by The Rolling Stones, released in 1978. Considered a highlight of their output and the best of their post-Exile on Main St. records, the album revitalized the band's career upon its release and re-established The Rolling Stones as a vital rock and roll band in an era infused with punk rock and disco. It also became the band's biggest-selling album in the United States, with more than six million copies to date. With the advent of punk rock, The Rolling Stones, among many of their musical contemporaries, were being targeted by some in the movement <a href="https://www.last.fm/music/The+Rolling+Stones/Some+Girls">Read more on Last.fm</a>.', 'content': 'Some Girls is an album by The Rolling Stones, released in 1978. Considered a highlight of their output and the best of their post-Exile on Main St. records, the album revitalized the band's career upon its release and re-established The Rolling Stones as a vital rock and roll band in an era infused with punk rock and disco. It also became the band's biggest-selling album in the United States, with more than six million copies to date.
With the advent of punk rock, The Rolling Stones, among many of their musical contemporaries, were being targeted by some in the movement as cultural dinosaurs, compromising their standing. Mick Jagger felt invigorated by the provocations and was determined to answer them lyrically. It helped, however, that almost all the punks had, openly or not, idolized the Stones in the 1960s and were heavily influenced by the band's rebellious records from that era.

At least as important for the band's reinvigoration was the addition of Ronnie Wood to the lineup, as Some Girls was the first album recorded with him as a full member. His guitar playing style meshed with that of Keith Richards. Wood's pedal steel playing would become one of the band's hallmarks, and his unconventional uses of the instrument are prominent on Some Girls. In addition, Jagger, who had learned to play guitar over the previous decade, contributed a third guitar part to many songs. This gave songs like "Respectable" a three-guitar lineup. <a href="https://www.last.fm/music/The+Rolling+Stones/Some+Girls">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '12 Dec 2018, 01:04', 'summary': 'Janet Jackson's Rhythm Nation 1814 (commonly referred to as Rhythm Nation) is the fourth studio album by American singer Janet Jackson, released on September 19, 1989, by A&M Records. Although label executives wanted material similar to her previous album, Control (1986), Jackson insisted on creating a concept album addressing social issues. Collaborating with songwriters and record producers Jimmy Jam and Terry Lewis, she drew inspiration from various tragedies reported through news media, exploring racism, poverty, and substance abuse, in addition to themes of romance. Although its primary concept was met with mixed reactions, its composition received critical acclaim. Jackson came <a href="https://www.last.fm/music/Janet+Jackson/Rhythm+Nation+1814">Read more on Last.fm</a>.', 'content': 'Janet Jackson's Rhythm Nation 1814 (commonly referred to as Rhythm Nation) is the fourth studio album by American singer Janet Jackson, released on September 19, 1989, by A&M Records. Although label executives wanted material similar to her previous album, Control (1986), Jackson insisted on creating a concept album addressing social issues. Collaborating with songwriters and record producers Jimmy Jam and Terry Lewis, she drew inspiration from various tragedies reported through news media, exploring racism, poverty, and substance abuse, in addition to themes of romance. Although its primary concept was met with mixed reactions, its composition received critical acclaim. Jackson came to be considered a role model for youth because of her socially conscious lyrics.

Noted for its use of sample loop and utilizing swing note and synthesized percussion throughout its production, the album encompasses a variety of musical styles, such as new jack swing, hard rock, pop, dance and industrial music. The songs range from mechanized dance rhythms to soft balladry, giving it appeal across multiple radio formats. It became the singer's second consecutive album to top the Billboard 200 albums chart in the United States. Certified six-times platinum by the Recording Industry Association of America (RIAA), it became the country's best-selling album of 1990 and has sold an estimated 12 million copies worldwide. Due to its innovative production and lyrical exploration, critics have come to regard it as the pinnacle of Jackson's artistic achievement. It has been cited as an influence in various musical trends, inspiring numerous artists.

It is the only album in the history of the US Billboard Hot 100 singles chart to have seven commercial singles peak within the top five positions. It is also the only album to produce number one hits on the chart in three separate calendar years (1989–1991). The 30-minute Rhythm Nation 1814 film, a screenplay depicting two aspiring musicians whose lives are disrupted by substance abuse, aired on MTV to promote the album. Jackson received nine Grammy Award nominations, becoming the first woman to be nominated for Producer of the Year and winning Best Long Form Music Video for Rhythm Nation 1814. Her Rhythm Nation World Tour 1990 became the most successful debut concert tour by a recording artist, in addition to setting venue records in Japan. She was regarded as a fashion icon, with her "Rhythm Nation" attire being emulated by youth. Proceeds from the tour were used to establish the Rhythm Nation Scholarship and fund other educational programs. Jackson received the MTV Video Vanguard Award and the star on the Hollywood Walk of Fame for her significant contributions to popular culture. <a href="https://www.last.fm/music/Janet+Jackson/Rhythm+Nation+1814">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

