In 2003 the TV network VH1 named it the 70th greatest album in any genre. Call Me was a Top 10 Billboard Pop Album, and the third #1 Soul Album. In 2003, the album was ranked number 289 on Rolling Stone magazine's list of the 500 greatest albums of all time, and 290 in a 2012 revised list.

Praised for his emotive singing style, Green here incorporates country influences, covering both Willie Nelson and Hank Williams. This album contained three top 10 singles on the Billboard Hot 100: "You Ought to Be with Me," "Here I Am (Come and Take Me)" and "Call Me (Come Back Home)." <a href="https://www.last.fm/music/Al+Green/Call+Me">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2020, 01:53', 'summary': 'Weezer (commonly known as the Blue Album) is the eponymous debut studio album by American rock band Weezer, released on May 10, 1994 by DGC Records. The album came two years after the band's founding, after they initially struggled as an alternative to grunge music, which was prevalent in Los Angeles during the early 1990s. It was almost entirely arranged and composed by frontman Rivers Cuomo, who also anticipated to lead the band in self-producing the album. However, at the behest of DGC, the band was required to include a producer, and collectively opted for Cars frontman Ric Ocasek. Most <a href="https://www.last.fm/music/Weezer/Weezer+(Blue+Album)">Read more on Last.fm</a>.', 'content': 'Weezer (commonly known as the Blue Album) is the eponymous debut studio album by American rock band Weezer, released on May 10, 1994 by DGC Records. The album came two years after the band's founding, after they initially struggled as an alternative to grunge music, which was prevalent in Los Angeles during the early 1990s. It was almost entirely arranged and composed by frontman Rivers Cuomo, who also anticipated to lead the band in self-producing the album. However, at the behest of DGC, the band was required to include a producer, and collectively opted for Cars frontman Ric Ocasek. Most of the recording was conducted at Electric Lady Studios in New York City between August and September 1993, a period that coincided with founding guitarist Jason Cropper being fired and replaced by Brian Bell.

Under Ocasek's direction, the band opted for a brighter sound, while bassist Matt Sharp collaborated with Cuomo to ensure that the album contained an overriding sonic concept of treating the guitars and bass as isolated ten-string instruments, thus maximizing its potential when united. Lyrically, Weezer focuses on outsiderdom and social awkwardness, while also touching on melancholic themes of love, romance, and familial issues.

Weezer was supported by the singles "Undone – The Sweater Song", "Buddy Holly", and "Say It Ain't So", which, alongside their respective music videos, brought Weezer mainstream success. The album itself peaked at number sixteen on the US Billboard 200, and was certified triple platinum by 1995. It is also the band's best-selling album, having sold at least 3.3 million copies in the U.S. and over fifteen million copies worldwide by 2009. <a href="https://www.last.fm/music/Weezer/Weezer+(Blue+Album)">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '02 Feb 2019, 01:34', 'summary': 'Fear of a Black Planet is the third studio album by American hip hop group Public Enemy. It was released on April 10, 1990, by Def Jam Recordings and Columbia Records. For the album, Public Enemy's Bomb Squad production team sought to expand on the dense, sample-layered sound of the group's 1988 record It Takes a Nation of Millions to Hold Us Back. Having fulfilled their initial creative ambitions with that album, Public Enemy aspired to create what lead rapper Chuck D called "a deep, complex album". Their songwriting was partly inspired by the controversy surrounding member Professor Griff and <a href="https://www.last.fm/music/Public+Enemy/Fear+of+a+Black+Planet">Read more on Last.fm</a>.', 'content': 'Fear of a Black Planet is the third studio album by American hip hop group Public Enemy. It was released on April 10, 1990, by Def Jam Recordings and Columbia Records.

For the album, Public Enemy's Bomb Squad production team sought to expand on the dense, sample-layered sound of the group's 1988 record It Takes a Nation of Millions to Hold Us Back. Having fulfilled their initial creative ambitions with that album, Public Enemy aspired to create what lead rapper Chuck D called "a deep, complex album". Their songwriting was partly inspired by the controversy surrounding member Professor Griff and his dismissal from the group in 1989.

Fear of a Black Planet features elaborate sound collages that incorporate varying rhythms, numerous samples, media sound bites, and eccentric loops, reflecting the songs' confrontational tone. Recorded during the golden age of hip hop, its assemblage of reconfigured and recontextualized aural sources preceded the sample clearance system that later emerged in the music industry. Fear of a Black Planet explores themes of organization and empowerment within the black community, social issues affecting African Americans, and race relations at the time. The record's criticism of institutional racism, white supremacy, and the power elite was partly inspired by Dr. Frances Cress Welsing's views on color. <a href="https://www.last.fm/music/Public+Enemy/Fear+of+a+Black+Planet">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '07 Jul 2010, 15:43', 'summary': 'Damn the Torpedoes is the third album by Tom Petty and the Heartbreakers released in 1979 by MCA Records. It was released to commercial success and critical acclaim becoming the band's breakthrough album. In 2003, the album was ranked number 313 on Rolling Stone magazine's list of the 500 greatest albums of all time. Damn the Torpedoes was the Heartbreakers first for MCA Records. Their old label, Shelter, had been sold to MCA. Petty struggled to legally detach himself from MCA, resulting in his bankruptcy. In the end the record company backed down, and he negotiated a deal that allowed <a href="https://www.last.fm/music/Tom+Petty+and+The+Heartbreakers/Damn+the+Torpedoes">Read more on Last.fm</a>.', 'content': 'Damn the Torpedoes is the third album by Tom Petty and the Heartbreakers released in 1979 by MCA Records. It was released to commercial success and critical acclaim becoming the band's breakthrough album. In 2003, the album was ranked number 313 on Rolling Stone magazine's list of the 500 greatest albums of all time.

Damn the Torpedoes was the Heartbreakers first for MCA Records. Their old label, Shelter, had been sold to MCA. Petty struggled to legally detach himself from MCA, resulting in his bankruptcy. In the end the record company backed down, and he negotiated a deal that allowed him to release his recordings on the new Backstreet Records label, manufactured and distributed by MCA. The album was recorded at Sound City in Van Nuys and Cherokee Studios in Hollywood. The title is a reference to a famous quote by Admiral David Farragut: "Damn the torpedoes, full speed ahead!".

Damn the Torpedoes was released in October of 1979. The album was a breakthrough for Petty and the Heartbreakers. It was his first top 10 album rising to #2 hit (for seven weeks and kept from #1 by Pink Floyd's The Wall) on the Billboard's Albums chart. It yielded two songs that made the top-fifteen on the Billboard Hot 100  singles chart, "Don't Do Me Like That" (#10) and "Refugee" (#15). It was a commercial success as well. Thanks to the new co-producer Jimmy Iovine, Damn the Torpedoes proved to be a major leap forward in production. <a href="https://www.last.fm/music/Tom+Petty+and+The+Heartbreakers/Damn+the+Torpedoes">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '01 Jan 2012, 12:02', 'summary': 'Pink Moon is the third and final album by English musician Nick Drake. It was recorded at midnight in two separate two-hour sessions, over two days in October 1971, featuring only Nick Drake's vocals and guitar, as well as some piano later overdubbed by Drake on the title track. Initially, Pink Moon garnered a small amount of critical attention, but decades after Drake's death it received widespread public and critical acclaim. The music on Pink Moon is sparse and unadorned (especially in comparison to Drake's previous recordings), leading some to consider it to be the least accessible of his three <a href="https://www.last.fm/music/Nick+Drake/Pink+Moon">Read more on Last.fm</a>.', 'content': 'Pink Moon is the third and final album by English musician Nick Drake. It was recorded at midnight in two separate two-hour sessions, over two days in October 1971, featuring only Nick Drake's vocals and guitar, as well as some piano later overdubbed by Drake on the title track.

Initially, Pink Moon garnered a small amount of critical attention, but decades after Drake's death it received widespread public and critical acclaim. The music on Pink Moon is sparse and unadorned (especially in comparison to Drake's previous recordings), leading some to consider it to be the least accessible of his three albums, though it nevertheless continues to be thought of by many of his fans as his greatest work.

The cover of the album features an illustration by the partner of Drake's sister Gabrielle, Michael Trevithick. <a href="https://www.last.fm/music/Nick+Drake/Pink+Moon">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '08 Aug 2020, 06:49', 'summary': 'In the Jungle Groove is a compilation album by American funk musician James Brown, released in August 1986 by Polydor Records. Originally issued to capitalize on the popularity of Brown's music in hip hop circles at the time, it includes the first album release of the much-sampled single "Funky Drummer" (1969), along with a selection of previously unreleased tracks, alternate takes, and remixes. The original recordings were produced by Brown, while the reissue was produced by Cliff White and Tim Rogers. A similar follow-up compilation, Motherlode, was released in 1988. The album's title is taken from a song Brown recorded <a href="https://www.last.fm/music/James+Brown/In+the+Jungle+Groove">Read more on Last.fm</a>.', 'content': 'In the Jungle Groove is a compilation album by American funk musician James Brown, released in August 1986 by Polydor Records.

Originally issued to capitalize on the popularity of Brown's music in hip hop circles at the time, it includes the first album release of the much-sampled single "Funky Drummer" (1969), along with a selection of previously unreleased tracks, alternate takes, and remixes. The original recordings were produced by Brown, while the reissue was produced by Cliff White and Tim Rogers. A similar follow-up compilation, Motherlode, was released in 1988.

The album's title is taken from a song Brown recorded in the studio in August 1970. The full recording of the song "In the Jungle Groove" remains unissued; however, on the album its introduction is appended to the beginning of "I Got to Move", another previously unreleased song recorded at the same session. A remastered and expanded 2003 reissue of In the Jungle Groove added a bonus track, an extended version of "Blind Man Can See It" from the Black Caesar soundtrack album <a href="https://www.last.fm/music/James+Brown/In+the+Jungle+Groove">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '06 Jun 2015, 11:36', 'summary': 'In Rainbows is the seventh studio album by the English alternative rock band Radiohead. It was first released on 10 October 2007 as a digital download that customers could order for whatever price they saw fit, followed by a standard CD release in most countries during the last week of 2007. The album was released in North America on 1 January 2008. In Rainbows was Radiohead's first release after the end of their contract with EMI and the end of the longest gap between studio albums in their career. In Rainbows was recorded in London, Somerset, Wiltshire and Oxfordshire with <a href="https://www.last.fm/music/Radiohead/In+Rainbows">Read more on Last.fm</a>.', 'content': 'In Rainbows is the seventh studio album by the English alternative rock band Radiohead. It was first released on 10 October 2007 as a digital download that customers could order for whatever price they saw fit, followed by a standard CD release in most countries during the last week of 2007. The album was released in North America on 1 January 2008. In Rainbows was Radiohead's first release after the end of their contract with EMI and the end of the longest gap between studio albums in their career.

In Rainbows was recorded in London, Somerset, Wiltshire and Oxfordshire with producers Mark Stent and Nigel Godrich. Radiohead worked on the songs for more than two years, beginning in early 2005. In between recording, the band toured Europe and North America for three months in 2006. Radiohead used a wide variety of musical styles on the album, incorporating string arrangements and electronic music, pianos, celestes and the ondes Martenot, yet renewing their focus on guitars, drums and bass as lead instruments. The songwriting on In Rainbows was more personal than that of Radiohead's other work, with singer Thom Yorke describing it as his attempt to write "seduction songs".

 Upon its retail release, In Rainbows entered the United World Chart, UK Album Chart, and the U.S. Billboard 200 at number one. In Rainbows also earned widespread critical acclaim, and several publications ranked it as one of the best albums of 2007. <a href="https://www.last.fm/music/Radiohead/In+Rainbows">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '06 Jun 2013, 17:42', 'summary': 'Aqualung is the fourth studio album by the rock band Jethro Tull. Released in 1971, Aqualung, despite the band's disapproval, is regarded as a concept album featuring a central theme of "the distinction between religion and God". The album's "dour musings on faith and religion" have marked it as "one of the most cerebral albums ever to reach millions of rock listeners". Aqualung's success marked a turning point in the band's career, who went on to become a major radio and touring act. Recorded at Island Records' studio in London, it was their first album with John Evan as a <a href="https://www.last.fm/music/Jethro+Tull/Aqualung">Read more on Last.fm</a>.', 'content': 'Aqualung is the fourth studio album by the rock band Jethro Tull. Released in 1971, Aqualung, despite the band's disapproval, is regarded as a concept album featuring a central theme of "the distinction between religion and God". The album's "dour musings on faith and religion" have marked it as "one of the most cerebral albums ever to reach millions of rock listeners". Aqualung's success marked a turning point in the band's career, who went on to become a major radio and touring act.

Recorded at Island Records' studio in London, it was their first album with John Evan as a full-time member, their first with new bassist Jeffrey Hammond and last album featuring Clive Bunker on drums. Something of a departure from the band's previous work, the album features more acoustic material than previous releases; and—inspired by photographs of homeless people on the Thames Embankment taken by singer Ian Anderson's wife Jennie—contains a number of recurring themes, addressing religion along with Anderson's own personal experiences.

Aqualung has sold over 7 million units worldwide according to Anderson, and is thus Jethro Tull's best selling album. The album was generally well-received critically, and has been included on several music magazine best of lists. The album spawned one single, "Hymn 43", and has been cited as an inspiration by bands such as Iron Maiden. <a href="https://www.last.fm/music/Jethro+Tull/Aqualung">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '09 Sep 2008, 13:22', 'summary': 'Play is the sixth studio album by the music artist Moby. While some of Moby's earlier work garnered critical and commercial success within the electronic dance music scene, Play was his first true pop success. The album introduced Moby to a worldwide mainstream audience, not only through hit singles, but also through unprecedented licensing of his music in films, television and commercial advertisements. One of the notable aspects of Play, as opposed to other electronic albums of the time, was the way in which it combined old gospel and folk music rhythms with modern house sensibilities. Moby sampled heavily from <a href="https://www.last.fm/music/Moby/Play">Read more on Last.fm</a>.', 'content': 'Play is the sixth studio album by the music artist Moby. While some of Moby's earlier work garnered critical and commercial success within the electronic dance music scene, Play was his first true pop success. The album introduced Moby to a worldwide mainstream audience, not only through hit singles, but also through unprecedented licensing of his music in films, television and commercial advertisements.

One of the notable aspects of Play, as opposed to other electronic albums of the time, was the way in which it combined old gospel and folk music rhythms with modern house sensibilities. Moby sampled heavily from the collected field recordings of Alan Lomax in songs such as "Honey," "Find My Baby," "Why Does My Heart Feel So Bad?" and "Natural Blues," while the track "Run On" was inspired by the traditional "God's Gonna Cut You Down." The album also has more purely electronic tracks, as well as the rock-influenced single "South Side" and the more ambient "Porcelain."

Inside the booklet included with the album, there are five short essays written by Moby, on topics such as veganism, fundamentalism, and humanitarianism. After the essays is a disclaimer written by Moby: "These essays are not really related to the music, so if you hate the essays you might still like the music, and if you like the essays you might hate the music. Who knows, maybe by some bizarre twist of fate you'll like them both." <a href="https://www.last.fm/music/Moby/Play">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.'}

{'published': '10 Oct 2016, 16:05', 'summary': 'Bat out of Hell is a 1977 album by singer Meat Loaf, songwriter Jim Steinman, and producer Todd Rundgren that became the third best-selling album worldwide behind Michael Jackson's Thriller and AC/DC's Back In Black, continuing to sell approximately 200,000 per year. Rolling Stone magazine ranked it at number 343 on its list of the 500 greatest albums of all time. Its musical style is influenced by Steinman's appreciation of Richard Wagner, Phil Spector and Bruce Springsteen. This album's title also became the title for two more Meat Loaf albums. Steinman produced the 1993 album, Bat out of Hell II: <a href="https://www.last.fm/music/Meat+Loaf/Bat+Out+of+Hell">Read more on Last.fm</a>.', 'content': 'Bat out of Hell is a 1977 album by singer Meat Loaf, songwriter Jim Steinman, and producer Todd Rundgren that became the third best-selling album worldwide behind Michael Jackson's Thriller and AC/DC's Back In Black, continuing to sell approximately 200,000 per year. Rolling Stone magazine ranked it at number 343 on its list of the 500 greatest albums of all time. Its musical style is influenced by Steinman's appreciation of Richard Wagner, Phil Spector and Bruce Springsteen.

This album's title also became the title for two more Meat Loaf albums. Steinman produced the 1993 album, Bat out of Hell II: Back into Hell. Desmond Child produced the 2006 album, Bat out of Hell III: The Monster Is Loose.

