{'published': '08 Aug 2020, 07:51', 'summary': 'Armed Forces is the third studio album by British musician Elvis Costello, released in the UK by Radar Records and in the US by Columbia in 1979. It was his second album with the Attractions, and the first to officially credit the Attractions on the cover. The album had the working title Emotional Fascism. The North American version omitted the track "Sunday's Best" and replaced it with Costello's version of Nick Lowe's "(What's So Funny 'Bout) Peace, Love, and Understanding," which had been released the previous November as the B-side of Lowe's "American Squirm" single. Initial pressings of the album <a href="https://www.last.fm/music/Elvis+Costello/Armed+Forces">Read more on Last.fm</a>.', 'content': 'Armed Forces is the third studio album by British musician Elvis Costello, released in the UK by Radar Records and in the US by Columbia in 1979. It was his second album with the Attractions, and the first to officially credit the Attractions on the cover. The album had the working title Emotional Fascism.

The North American version omitted the track "Sunday's Best" and replaced it with Costello's version of Nick Lowe's "(What's So Funny 'Bout) Peace, Love, and Understanding," which had been released the previous November as the B-side of Lowe's "American Squirm" single. Initial pressings of the album in the UK and US also included a promotional three-song EP, Live at Hollywood High.

